import { BitMap } from "./bitmap";
import { MerkelTreeViewer } from "./merkelTreeViewer";
import { RendererObject } from "./renderObject";
import { SideBar } from "./sidebar";

import { ContentJSON, Vertex, DownloadConfigLog, TreeLayoutLog, DownloadEntryLog, Parity, VertexEvent, ParityEvent } from "./interfaces";
import { COLORS, DLStatus, MSG, RepStatus } from "./constants";
import { parseLogParityEvent, parseLogVertexEntry } from "./utils";



export class App {
    renderer = new RendererObject();
    bitMap = new BitMap();
    merkelTree = new MerkelTreeViewer();
    sideBar = new SideBar();
    alpha = 0;
    s = 0;
    p = 0;
    dataElements = 0;
    nrOfDownload = 0;
    nrOfRepaired = 0;
    nrOfUnavailable = 0;
    LogCursor = 0;
    NrOfLogs: number = 0;
    CurrentFilename: string = "";
    vertices: Map<number, Vertex> = new Map();
    parities: Map<number, Parity>[] = [];
    parityShift: Map<number, number> = new Map();
    LogEntries: (VertexEvent | ParityEvent)[] = [];
    ParityLabels: string[] = [];



    constructor() {
        this.AddEventListener();
    }

    TestDev() {
        // TODO: FIX
        this.sideBar.FileInput.DevTest(devContent);
    }

    UpdateData() {

        this.renderer.UpdateData(this.alpha, this.s, this.p, this.vertices, this.parities, this.parityShift);
        this.bitMap.UpdateData(this.alpha, this.s, this.p, this.vertices, this.parities, this.parityShift);
        this.merkelTree.UpdateData(this.alpha, this.s, this.p, this.vertices, this.parities, this.parityShift);

        this.renderer.HandleUpdatedData();
        this.bitMap.HandleUpdatedData();
        this.merkelTree.HandleUpdatedDate(this.ParityLabels);
        this.sideBar.PlayBackEle.HandleUpdatedData(this.alpha, this.s, this.p, this.dataElements, this.LogEntries, this.NrOfLogs);

    }

    AddEventListener() {
        window.addEventListener("bitmap-clicked", this.HandleBitMapClicked.bind(this) as EventListener);
        window.addEventListener("new-file-upload", this.HandleNewFileUploaded.bind(this) as EventListener);
        window.addEventListener("log-changed-clicked", this.HandleLogChangedClicked.bind(this) as EventListener);
        window.addEventListener("log-changed", this.HandleLogChanged.bind(this) as EventListener);
        window.addEventListener("logEntryEvents", this.HandleLogEntryEvents.bind(this) as EventListener);
        window.addEventListener("resetEverything", this.HandleResetEverything.bind(this) as EventListener);
        window.addEventListener('resize', this.HandleWindowResize.bind(this), false);
    }

    HandleResetEverything(e: CustomEvent) {
        for (var vertex of this.vertices.values()) {
            vertex.Color = COLORS.GREY;
            vertex.DamagedChildren = []
        }
        for (var parityMap of this.parities) {
            for (var parity of parityMap.values()) {
                parity.Color = COLORS.GREY;
                parity.To = null;
                parity.DamagedChildren = [];
            }
        }

        this.nrOfDownload = 0;
        this.nrOfRepaired = 0;
        this.nrOfUnavailable = 0;

        this.bitMap.Reset();
    }
    HandleLogEntryEvents(e: CustomEvent) {
        var vertexEvent: VertexEvent;
        var parityEvent: ParityEvent;
        var vertex: Vertex;
        var parity: Parity;
        for (vertexEvent of e.detail.VertexEvents) {
            vertex = this.vertices.get(vertexEvent.Position)!;
            switch (vertex.Color) {
                case COLORS.GREEN:
                    this.nrOfDownload--;
                    break;
                case COLORS.RED:
                    this.nrOfUnavailable--;
                    break;
                case COLORS.BLUE:
                    this.nrOfRepaired--;
                    break;

            }
            switch (vertexEvent.NewColor) {
                case COLORS.GREEN:
                    this.nrOfDownload++;
                    break;
                case COLORS.RED:
                    this.nrOfUnavailable++;
                    break;
                case COLORS.BLUE:
                    this.nrOfRepaired++;
                    break;

            }
            vertex.Color = vertexEvent.NewColor;
        }
        // TODO FIX
        for (parityEvent of e.detail.ParityEvents) {
            let strand = parityEvent.Strand;
            parity = this.parities[strand].get(parityEvent.From)!;
            parity.To = parityEvent.To;
            parity.Color = parityEvent.NewColor;
            if (parityEvent.From == 0) {
                console.log("#asdf")
            }
        }

        this.renderer.createTwoDimView();
        this.bitMap.UpdateVertex((e.detail.VertexEvents as VertexEvent[]).map(v => v.Position))
        this.merkelTree.UpdateVertex((e.detail.VertexEvents as VertexEvent[]).map(v => v.Position))
        this.sideBar.PlayBackEle.UpdateStats(this.nrOfDownload, this.nrOfUnavailable, this.nrOfRepaired);
    }
    HandleBitMapClicked(e: CustomEvent) {
        this.renderer.GoTo(e.detail.vertexIndex)
    }
    HandleNewFileUploaded(e: CustomEvent) {
        this.CurrentFilename = e.detail.fileName;
        this.NrOfLogs = e.detail.nrOfLogs;
        this.sideBar.PlayBackEle.CreateChangeLogBtns(this.NrOfLogs);
        this.sideBar.FileInput.ChangeLog(0);
    }
    HandleLogChangedClicked(e: CustomEvent) {
        let newLog = e.detail.changeToLog;
        if (newLog < 0 || newLog > this.NrOfLogs) {
            return
        }
        this.sideBar.FileInput.ChangeLog(newLog);
    }
    HandleLogChanged(e: CustomEvent) {
        var lineCounter, parityIndex: number;
        lineCounter = 0;

        let content: ContentJSON[] = e.detail.newContent
        var line: ContentJSON = content[lineCounter++]
        this.alpha = (line.log as DownloadConfigLog).alpha;
        this.s = (line.log as DownloadConfigLog).s;
        this.p = (line.log as DownloadConfigLog).p;
        this.dataElements = (line.log as DownloadConfigLog).dataElements;
        this.nrOfDownload = 0;
        this.nrOfRepaired = 0;
        this.nrOfUnavailable = 0;
        this.ParityLabels = (line.log as DownloadConfigLog).parityLabels;
        var dataShiftRegister = (line.log as DownloadConfigLog).dataShiftRegister;
        var parityShift = (line.log as DownloadConfigLog).parityLeafIdToCanonIndex;
        this.parityShift.clear();
        var a = parityShift[2];
        for (var value in parityShift) {
            this.parityShift.set(Number.parseInt(value), parityShift[value]);
        }
        var AdrToStrand: Map<string, number> = new Map();
        this.vertices.clear();
        this.parities = Array(this.alpha);
        for (let i = 0; i < this.parities.length; i++) {
            this.parities[i] = new Map();
        }
        var log: TreeLayoutLog;
        line = content[lineCounter++]
        while (line.msg == MSG.TreeLayout) {
            log = line.log as TreeLayoutLog;
            if (line.type == "Data") {
                this.vertices.set(log.index, {
                    Index: dataShiftRegister[log.index],
                    Adr: log.key,
                    Color: COLORS.GREY,
                    Parent: log.parent ? dataShiftRegister[log.parent] : 0,
                    Depth: log.depth,
                    Children: [],
                    DamagedChildren: [],
                });
            } else {
                parityIndex = this.ParityLabels.indexOf(line.type!)
                this.parities[parityIndex].set(log.index, {
                    Index: log.index,
                    To: null,
                    Adr: log.key,
                    Color: COLORS.GREY,
                    Parent: log.parent || 0,
                    Depth: log.depth,
                    Children: [],
                    DamagedChildren: [],
                });
                AdrToStrand.set(log.key, parityIndex);
            }
            line = content[lineCounter++]
        }
        var swappedVertex: Vertex;
        var tempAdr: string;
        var tempDepth: number;
        var allReadySwapped: number[] = [];
        for (var [position, vertex] of this.vertices.entries()) {
            if (vertex.Parent != 0) {
                this.vertices.get(vertex.Parent)?.Children.push(dataShiftRegister[position]);
            }
            if (position != vertex.Index && (!allReadySwapped.includes(position) || !allReadySwapped.includes(vertex.Index))) {
                swappedVertex = this.vertices.get(vertex.Index)!;

                tempAdr = vertex.Adr;
                vertex.Adr = swappedVertex.Adr;
                swappedVertex.Adr = tempAdr;

                tempDepth = vertex.Depth;
                vertex.Depth = swappedVertex.Depth;
                swappedVertex.Depth = tempDepth;

                allReadySwapped.push(position, vertex.Index);
            }
        }
        for (var parityMap of this.parities) {
            for (var [position, parity] of parityMap.entries()) {
                if (parity.Parent != 0) {
                    parityMap.get(parity.Parent)!.Children.push(parity.Index);
                }
            }
        }

        var logEntry: DownloadEntryLog | TreeLayoutLog;
        this.LogCursor = 0;
        this.LogEntries = [];
        while (line.msg == MSG.DlEntry || line.msg == MSG.ParityTreeEntry) {
            if (line.msg == MSG.DlEntry) {
                logEntry = line.log as DownloadEntryLog;

                if (logEntry.downloadStatus == DLStatus.Pending || logEntry.repairStatus == RepStatus.Pending) {
                    line = content[lineCounter++]

                    continue
                }
                if (logEntry.parity) {
                    this.LogEntries.push(parseLogParityEvent(logEntry, AdrToStrand.get(logEntry.key) || 0))
                } else {
                    this.LogEntries.push(parseLogVertexEntry(logEntry))
                }
            }
            else if (line.msg == MSG.ParityTreeEntry) {
                logEntry = line.log as TreeLayoutLog;
                this.LogEntries.push({
                    From: logEntry.index,
                    To: -1,
                    NewColor: COLORS.GREEN,
                    Strand: AdrToStrand.get(logEntry.key) || 0,
                } as ParityEvent)
            }
            line = content[lineCounter++]
        }
        this.UpdateData();

    }
    HandleWindowResize() {
        this.renderer.onWindowResize();
        this.merkelTree.onWindowResize();
        this.bitMap.onWindowResize();
    }

}
